  blueprint_courses_is_an_account_level_feature_opti_3bf307d: "Blueprint-emner er et funksjonsvalg på kontonivå. For å redigere låseinnstillinger på innholdsfortegnelsen til diskusjoner må 'Emner - legg til / rediger / slett' og 'Diskusjoner - vis' også være aktivert. Hvis denne tillatelsen ikke er aktivert og 'Emner - legg til / rediger / slett' og 'Diskusjoner - vis' er aktiverte, kan låseinnstillinger for blueprint redigeres på individuelle diskusjoner."
