  each_bar_is_an_assignment_the_green_layer_represen_b6536ab1: "Hver stolpe er en oppgave. Det grønne laget representerer prosentandelen av elevene som leverte inn oppgaven *i tide*. Innleveringer som er **for sein** er gule, og innleveringer som ***mangler*** er røde."
  each_bar_is_one_assignment_the_thin_vertical_whisk_17840129: |-
      Hver stolpe er en oppgave. Den tynne vertikale linjen utvider seg fra den laveste scoren som en student har i kurset til den høyeste. Den tykke stolpen strekker seg fra den 25.
      persentilen til den 75. med merke på medianen.
  each_bar_is_one_assignment_the_thin_whisker_extend_425bf274: "Hver linjen er ett oppdrag. Den tynne værhår strekker seg fra den laveste poengsummen for enhver student i kurset til den høyeste poengsummen. Tykkere linjen strekker seg fra den 25. persentilen til den 75., med median merket. Studentens poengsum er merket med en prikk."
  each_bar_represents_the_number_of_page_views_on_th_3f833fcd: "Hver linjen representerer antall *sidevisninger* på den dagen. En oransje søyle viser at studenten **tok noen handling** innenfor kurset på den dagen."
  each_bar_represents_the_number_of_page_views_on_th_442f8465: "Hver stolpe representerer antall *sidevisninger* på den dagen. En oransje stolpe viser at  noen **tok en handling** innenfor et kurs på denne dagen."
  each_bar_represents_the_number_of_page_views_on_th_66e1dcc0: "Hver linjen representerer antall *sidevisninger* på den dagen. En oransje søyle viser at noen bruker **tok en handling** innenfor kurset på den dagen."
  each_bar_represents_the_number_of_page_views_relat_29d1e341: "Hver linjen representerer antall sidevisninger relatert til den kategorien."
  each_row_is_one_assignment_the_diamond_is_the_due__2a5c7d7c: "Hver rad er en oppgave. Diamanten er forfallsdato og baren strekker seg til innleveringsdato. Grønn indikerer en *på tide innsending*, gul **sen innlevering**, og rød en ***savnet oppdrag***. Grå diamanter er oppgaver uten forfallsdatoer er lagt inn på tidspunktet for innlevering."
