  enrollments_may_be_added_by_your_institution_stude_213d41a4: |-
      Påmeldte kan legges til av institusjonens studentinformasjonssystem (SIS). Hvis en påmelding opprettes via SIS, er det kun administratorer som kan fjerne påmeldingen fra emnet.
              Hvis kontoinnstillingen Åpen registrering er aktivert, kan brukere med denne tillatelsen legge til observatører til et emne fra Emnepersoner-siden via e-postadresse eller innloggings-ID, selv om observatøren ikke allerede har en Canvas-konto.
              For å koble en observatør til en student, må Brukere - administrer innloggingsdetaljer og Samtaler - send meldinger til individuelle emnedeltakere være aktivert.
              For å generere en paringskode på vegne av studenter som skal deles med en observatør, må Brukere - Generer observatørparingskode for studenter også være aktivert.
              For å vise listen over observatører i emnet, må Brukere - vis liste være aktivert.
              For å vise SIS-ID-er, må SIS-Data - les være aktivert. For å legge til en observatør til et emne via SIS-ID må 'SIS-data - administrer' også være aktivert.
  enrollments_may_be_added_by_your_institution_stude_40297562: |-
