  enrollments_may_be_added_by_your_institution_stude_4a538c66: |-
      Påmeldte kan legges til av institusjonens studentinformasjonssystem (SIS). Hvis en påmelding opprettes via SIS, kan bare administratorer fjerne påmeldingen fra emnet.
              For å gå til Folk-siden, må Brukere - vis liste være aktivert. Hvis kontoinnstillingen 'Åpen registrering' er aktivert vil brukere med denne tillatelsen kunne legge til studenter til et emne via e-postadresse hvis brukeren ikke allerede har en Canvas-konto. For å vise SIS-ID-er, må 'SIS-data - lese'  være aktivert. For å legge til en bruker til et emne via SIS-ID må 'SIS-data - administrer' også være aktivert. For å redigere en students seksjon må 'Brukere - vis liste' og 'Samtaler - send meldinger til individuelle emnedeltakere' også være aktivert. For å lenke en observatør til en student må 'Samtaler - send meldinger til individuelle emnedeltakere' også være aktivert.
