            innleveringer og erfaringer som skjer i løpet av
            læringsprosessen din. Du kan bruke en ePortfolio til å: 
            
            * Vise innleveringer du er stolt av så flere enn bare faglæreren din kan se dem
            * Snakke om tankerekken og arbeidet bak innleveringene dine
            * Få et helhetlig overblikk over utdanningserfaringen din
            * Dele arbeidet ditt med venner, framtidige arbeidsgivere, osv.
            
            ePortfolioer kan være offentlige, alle kan se, eller private, bare du kan se,
            og dette kan endres når som helst.
            
            Klar til å begynne? Klikk på knappen.
    wizard_box: 
      finish: 
        body: "Klar til å starte? Du kan alltids komme tilbake til denne veiviseren fra enhver side ved å trykke på \"%{help_link_text}\"."
      headers: 
        finish: "La oss sette i gang"
        getting_started: "Kom i gang"
        instructions: "Bruke en ePortfolio"
        introduction: Introduksjon
        page_content: Sideinnhold
        pages: Seksjonssider
        sections: Porteføljeseksjoner
        settings: "ePortfolio innstillinger"
        submissions: "Legge til innleveringer"
      introduction: 
        body: "ePortfolioer er et sted hvor du kan demonstrere arbeidet ditt. De består av seksjoner og sider. Listen over seksjoner er på venstre side av vinduet (%{showme1}). Hver seksjon kan ha flere sider, som vises på høyre side av vinduet (%{showme2})."
      links: 
        portfolio: "Vis porteføljen"
      page_content: 
        body1: "Innholdet du ser på en side er det samme innholdet besøkende vil se. For å redigere innholdet, klikk \"%{edit_link_text}\"-lenken (%{showme}) og siden vil endres til redigeringsmodus."
        body2: "Nå redigerer du! Endre navn på siden eller endre kommentarvalg (%{showme1}) om du vil. Du kan lagre, forhåndsvise eller avbryte endringene når som helst ved å klikke på knappen på høyre side (%{showme2})."
        body3: "Innholdet er inndelt i underseksjoner, som hver har en stiplet bord. Du kan slette eller redigere innholdet i en underseksjon ved å klikke på %{edit_icon} - eller %{delete_icon}-ikonet i øvre høyre hjørne av underseksjonen."
        body4: "For å legge til nye underseksjoner, finn og klikk på innholdet du ønsker å legge til i valglisten på høyre side (%{showme})."
      pages: 
        body1: "Seksjoner har flere sider. Du kan se listen over sider for den valgte seksjonen på høyre side av vinduet (%{showme1}). For å organisere eller legge til sider, klikk på \"%{manage_pages}\" lenken (%{showme2})."
        body2: "Du kan omdøpe enhver side ved å klikke på %{edit_icon}-ikonet som dukker opp, slette en side ved å klikke på %{delete_icon}-ikonet, eller omorganisere rekkefølgen til sider ved å klikke og dra dem."
      sections: 
        body1: "Seksjoner listes opp på venstre side av vinduet (%{showme1}). Hver seksjon kan ha flere sider. For å organisere eller legge til seksjoner, klikk på \"%{manage_sections}\" (%{showme2})."
        body2: "Du kan gi hver seksjon ved å klikke på %{edit_icon}-ikonet som dukker opp, reorganisere seksjoner ved å klikke og dra dem, eller slette seksjoner ved å klikke på %{delete_icon}-ikonet."
      settings: 
        body: "For å endre innstillingene for din ePortfolio, klikk på \"ePortfolio-innstillinger\" (%{showme}). Du kan endre navn på porteføljen og endre om den er offentlig eller privat. Private porteføljer er kun synlige for de du har gitt tilgang."
      submissions: 
        body1: "Du har kanskje lagt merke til at det er en liste over nye innleveringer for klassene dine nederst på siden (%{showme}). Du kan raskt legge til innleveringer på nye sider i porteføljen din fra denne siden. Bare klikk på innleveringen du ønsker å legge til, så vil en enkel dialogboks dukke opp."
        body2: "Flott! For å fullføre innleggingen av innleveringen må du velge hvilken seksjon du ønsker å legge den til på og gi siden et navn. Etter at du har klikket på \"Legg til side\" blir du ført den nye siden så du kan redigere den mer detaljert."
