    course_already_started: 
      email: 
        body: |-
            Hei %{user},
            
            %{course}, emnet ditt på Canvas Network startet for et par dager siden, og vi har lagt merke til at du ikke har loggen inn ennå. Vi ville bare sende deg en siste påminnelse i tilfelle du har glemt det.
            
            For å logge inn, gå til %{site} og skriv inn ditt brukernavn og passord. Hvis du ikke har angitt et passord ennå, kan du angi et her: %{password_url}
            
            Hvis du rett og slett ikke kan lage akkurat dette emnet, kan du gjerne bla deg gjennom emnekatalogen på %{site} for å finne noe annet som inspirerer deg. Nye emner blir lagt til hele tiden!
            
            Vi håper å se deg snart,
            
            Canvas Network
        course_already_started: "Emnet ditt har allerede begynt"
    course_required_materials: 
      email: 
        body: |-
            Hei %{user},
            
            Gode nyheter! %{course}, emnet du meldte deg på via Canvas Network starter snart.
            
            For å sikre at du får mest mulig ut av emnet ditt, bør du se etter spesielle instruksjoner eller emnemateriell som er oppført av faglæreren.  Du kan se etter dette på siden med emnedetaljer på Canvas Network, eller bare klikke på lenken nedenfor.
            
            %{url}
            
            Fortsett å lære,
            
            Canvas Network
        course_required_materials: "Materiell og instruksjoner for %{course}"
    course_started: 
      email: 
        body: |-
            Hallo %{user},
            
            Dette er en vennlig påminnelse om at %{course}, emnet ditt i Canvas Network, starter i dag. Du kan nå logge inn på %{site} og komme i gang!
            
            Ikke glem å sette opp Canvas Network-profilen din, slik at andre i emnet vet hvem du er. Du kan oppdatere profilen din på %{profile_url}
            
            Fortsett å lære,
            
            Canvas Network
        course_starts_today: "Emnet ditt begynner i dag"
    course_starts_in_week: 
      email: 
        body: |-
            %{user},
            
            Det nærmer seg! %{course}, et emne du meldte deg på via Canvas Network, begynner neste uke. Vi vet hvor spent du må være, og vi er også spente.
            
            Hva kan du gjøre for å bli klar?
            
            Hvis du ikke allerede har opprettet din Canvas Network-profil, kan du logge på og sette den opp på Canvas.net. Profilen din vil hjelpe andre i emnet å vite hvem du er. Det kan du også sette opp varslingspreferansene dine.
            
            Til slutt kan du se gjennom nødvendige materialer og eventuelle instruksjoner for emnet ditt her: %{url}
            
            Fortsett å lære,
            
            Canvas Network
        course_starts_next_week: "Emnet ditt starter neste uke"
