  new_sis_integrations: |-
      Denne funksjonen gjelder for alle institusjoner med en eksisterende SIS Canvas-integrasjon.
      Alle kunder som for øyeblikket bruker løsningen sende tilbake vurdering i Canvas eller
      partnerprodukter, må aktivere denne funksjonen for økt oppgavedata
      validering av arbeidsflyten. Når det er aktivert viser denne funksjonen de nye SIS
      -innstillinger for integrering for SIS-synkronisering (Oppgavenivå for å sende vurdering tilbake) i konto
      innstillinger. Funksjonsvalget Publiser til SIS er innlemmet i disse nye
      innstillingene og vil som standard aktiveres.
