    grade_export: 
      description: "Vurderingseksport for SIS"
      name: Vurderingseksport
    grade_export_settings: 
      description: |-
          Denne plug-in-modulen lar sluttvurderinger publiseres tilbake til et studentinformasjonssystem (SIS).  Når aktivert, vil brukeren få et alternativ i vurderingsoversikten om å publisere disse vurderingene.  Dette skjer via en INNLEGG-forespørsel til det spesifiserte publiseringsendepunktet.  Hver type defineres dets eget innholdsformat og mimetype.  Svaret fra endepunktet spiller ingen rolle og ignoreres for øyeblikket. 
          
          For eksempel vil Instructure-formatert CSV PUBLISERE en CSV-fil med mime-type 'text/csv' til det angitte endepunktet, som inneholder følgende kolonner: 
          
          "publisher\_id", "publisher\_sis\_id", "course\_id", "course\_sis\_id", "section\_id", "section\_sis\_id", "student\_id", "student\_sis\_id", "enrollment\_id", "enrollment\_status", "score", "grade", "custom\_grade\_status"
          
          (Merk: «vurdering»-kolonnen returneres kundersom emnet spesifiserer en vurderingsstandard) 
          
          For hver student i emnet som publiseres, vil det være én eller flere rader i den publiserte csv-en. Spesifikt vil det være én rad for hver pålogging studenten har i emnets rotkonto.  For det meste vil dette føre til én rad per student, men hvis studenten har flere kontoer, vil det være en rad for hver av dem. 
          
          Hvis «Inkluder overstyring av sluttvurdering» er valgt og funksjonen for Overstyring av sluttvurdering er aktivert, vil studenter med en overstyring av vurdering/poengsum motta det i stedet for en beregnet poengsum og karakter.  Hvis funksjonen Egendefinerte statusetiketter er aktivert, vil "custom\_grade\_status"-kolonnen inneholde alle egendefinerte karakterstatuser som er brukt på overstyring av sluttvurderinger for den studenten.
      labels: 
        format_type: "Formattype for ytelse"
        include_final_grade_overrides: "Inkluder overstyring av sluttvurdering"
        publish_endpoint: "Endepunkt å publisere til"
        success_timeout: "Suksess i varslinger for tidsavbrudd (i sekunder)"
        wait_for_success: "Vent på beskjed om at alt er i orden"
