  this_report_provides_a_list_of_all_developer_keys__dd2bfadf: "Denne rapporten viser en liste over alle utviklernøkler som er tilgjengelige for institusjonen. Disse nøklene kan enten installeres direkte i rotkontoen rapporten kjøres fra, eller de kan arves fra overordnede rotkontoer. Utviklernøkler kan enten være API- eller LTI-nøkler."
  this_report_provides_all_active_eportfolios_for_th_f7432621: "Denne rapporten inneholder alle aktive e-porteføljer for den nåværende institusjonen. Velg alternativt ‘Bare inkluder e-porteføljer fra brukere uten påmeldinger’ for å redusere omfanget av e-porteføljeresultatene til de brukerne uten påmeldinger. Du kan også kjøre rapporten med ‘Inkluder slettede objekter’ for å bare inkludere de e-porteføljene som er slettet."
  this_report_provides_transparency_regarding_instru_6f9e227e: "Denne rapporten gir åpenhet om Instructure-ansattes tilgang til kontoen. En tilgangstillatelse gir en Instructure-ansatt tilgang til kontoen i en begrenset periode (for eksempel når de støtter kontoen eller svarer på en hendelse). Hvis en tilgangstillatelse utløper, må ansatte fornye tillatelsen før de kan få tilgang til kontoen via brukergrensesnittet eller API-en."
  this_report_shows_all_learning_outcomes_that_exist_e77bd04b: "Denne rapporten viser alle læringsutbytter som eksisterer i denne kontoen. Den resulterende CSV-filen vil ha en rad per læringsmål og vil vise detaljene til alle assosierte attributter for hvert læringsmål."
  this_report_shows_all_the_activity_from_users_enro_46394fa6: |-
      Denne rapporten viser all aktivitet fra brukere som er påmeldt i et gitt emne eller
        alle åpne emner i et gitt semester. Den resulterende csv-filen vil ha en rad per
        studentaktivitet og vil ha følgende overskrifter: enrollment_type, seksjons-id,
        seksjon sis-id, seksjonsnavn, emne-id, emne sis-id, emnenavn, semester-id, semester sis-id, semesternavn, bruker-id,
        bruker sis-id, brukernavn, innholdstype, innhold, antall visninger, antall deltakelser, sist
        sett. Antall visninger og antall deltakelser er talt fra
        begynnelsen frem til rapporten ble generert.
  this_report_shows_all_the_activity_from_users_enro_8f8e0ca1: |-
      Denne rapporten viser all aktivitet fra brukere som er påmeldt alle åpne emner
        innenfor en spesifikk tidsramme. Den resulterende csv-filen vil ha en rad per
        studentaktivitet og følgende overskrifter: seksjons-id, seksjon sis-id,
        seksjonsnavn, kurs-id, kurs sis-id, kursnavn, semester-id, semester sis-id,
        semesternavn, bruker-id, bruker sis-id, brukernavn, innholdstype, innhold, antall visninger,
        antall deltakelser, sist sett. Antall visninger og antall deltakelser er
        talt fra begynnelsen da rapporten ble generert.
        Maksimalt én måneds data blir hentet. Som standard vil den returnere
        data fra begynnelsen av forrige uke.
  this_report_shows_all_the_courses_for_a_given_term_3cdc11e5: "Denne rapporten viser alle emnene i en gitt termin. Den resulterende csv-filen vil ha en rad per emne, og vil vise emne id, sis id for emne, kortnavn for emner, emnenavnet, konto-id, konto sis-id, kontonavn, benyttet lagringsplass i MB og summen av alle filer i MB. Benyttet lagringsplass reflekterer alle filene som går mot emnekvoten. Summen av alle filene i emnet er summen av alle filene som er i emnet uansett påvirkninger på emnekvoten."
  this_report_shows_all_the_courses_for_a_given_term_9102a3d7: "Denne rapporten viser alle kursene i et gitt semester. Den resulterende CSV-filen vil ha en rad per kurs, og vil vise kurs-ID, kursets SIS-ID, kursets kortnavn, kursets navn, konto-ID, kontoens SIS-ID, kontonavn og brukt lagringsplass i MB."
  this_report_shows_grading_period_grades_and_overal_a86346a: "Denne rapporten viser vurderingene for vurderingsperioden (og generelle vurderinger for emne) for hver påmeldt student i et gitt semester. Den resulterende csv-filen vil ha én rad per brukerpåmelding."
