  when_disabled_new_or_updated_contextexternaltool_i_27e19300: |-
      Når det er deaktivert, vil nye eller oppdaterte installasjoner av ContextExternalTool (inkludert
      LTI 1.3-verktøy som er oppdatert automatisk på grunn av oppdateringer av utviklernøklene deres)
      få editor_button-plasseringen fjernet hvis det ikke er angitt en icon_url eller
      canvas_icon_class i innstillingene (gammel atferd). Når det er aktivert,
      blir ikke plasseringen fjernet, så verktøy uten ikoner vil vise et standardikon
      (med en farge/bokstav basert på verktøynavn og verktøy-/utviklernøkkel-ID).
  when_disabled_students_can_still_send_individual_m_3bf396f2: "Hvis deaktivert vil studenter fortsatt kunne sende individuelle meldinger til emnelærere, emne-LA-er og studenter som tilhører samme grupper på kontonivå."
