  when_enabled_collect_internal_analytics_metrics_us_88e81ee5: "Når aktivert, samle inn interne analyseberegninger ved hjelp av et distribuert system."
  when_enabled_for_a_child_account_of_a_non_centrall_8b126bc0: |-
      Når aktivert for en barnekonto i et ikke-sentralt administrert konsortium,
      vil ikke utviklernøkkelstatus og tokens fra det overordnede konsortiet bli
      arvet til barnekontoer av et underordnet konsortium. Når deaktivert, følges den gamle
      (inkonsekvente) atferden. Dette flagget gjelder bare for
      _child_ konsortium-kontoer. Dette flagget påvirker ikke sentralt administrerte konsortier på
      noen måte.
  when_enabled_for_an_account_sends_data_for_all_lti_77568a4f: |-
      Når aktivert for en konto, sender data for alle LTI-oppstarter til PandataEvents-systemet
      for spørring og visualisering. Krever at Log LTI-starter (sideadministrator) også er aktivert.
  when_enabled_for_the_parent_account_of_a_non_centr_4d7adbaa: |-
      Når aktivert for foreldrekontoen til et ikke-sentralt administrert konsortium,
      vil ikke det å slå på/av utviklernøkler i foreldrekontoen påvirke
      verktøyinstallasjoner for barnekontoene. Når deaktivert, vil det å slå på/av
      SiteAdmin-arvede utviklernøkler i foreldrekontoen til et ikke-sentral
      administrert konsortium påvirke (slette/gjenopprette) verktøy i barnekontoer
       (gammel atferd). Dette flagget gjelder bare for_parent_
       konsortium-kontoer. Dette flagget påvirker ikke sentralt administrerte konsortier på noen måte.
  when_enabled_global_javascript_and_css_files_can_b_ea21d216: "Når aktivert, kan globale JavaScript og CSS-filer lastes opp i *%{t_theme_editor}*."
  when_enabled_it_deprecates_the_short_message_servi_18c6ee3f: "Når den er aktivert, deaktiveres SMS (Short Message Service)."
  when_enabled_lti_1_1_speedgrader_launches_will_set_47dcded1: |-
      Når aktivert, vil LTI 1.1 SpeedGrader-lanseringer angi resource_link_id og
      resource_link_title til oppgavens ugjennomsiktige identifikator og
      oppgavetittel. Når funksjonsflagget er av, i SpeedGrader-lanseringer, vil resource_link_id
      og resource_link_title referere til verktøyet (ikke oppgaven) for
      non-NewQuizzes LTI 1.1-verktøy.
  when_enabled_lti_1_3_launches_that_would_be_associ_bfec33fb: |-
      Når LTI 1.3 er aktivert, vil lanseringer som er tilknyttet LTI 1.1-verktøyet
      hvis LTI 1.3-verktøyet ikke er til stede, inkludere oauth_consumer_key og
      oauth_consumer_key_sign egenskaper som en del av LTI 1.1-kravseksjonen.
  when_enabled_new_quizzes_provisions_will_use_the_d_f18d3c15: |-
      Når aktivert, vil Nye quizer-bestemmelser bruke den dedikerte Sideadministrator
      -servicebrukeren og DeveloperKey for å generere en tilgangs- og oppdateringnøkkel
  when_enabled_removes_support_for_passing_submitted_ce61e9e9: |-
      Når aktivert, fjernes støtte for å sende submittedAt som en toppnivåparameter i en
      LTI AGS-poengforespørsel, for bedre å samsvare med LTI AGS-spesifikasjonen.
  when_enabled_root_accounts_with_a_ready_for_new_qu_b412daa: |-
      Når dette er aktivert, vil rotkontoer med en `:ready_for_new_quizzes_provision`-nøkkel
      i innstillingene som ikke er blitt provisjonert, bli provisjonert. Denne
      sjekken og provisjonen skjer på hvert område rundt midnatt for det aktuelle området.
  when_enabled_sends_data_for_all_lti_launches_to_th_2c76d174: |-
      Når aktivert, sender data for alle LTI-oppstarter til PandataEvents-systemet
